import React from "react";
import Header from "../Components/Header";
import SkillChart from "../Components/SkillsChart"
function SkillPage(props) {
    var data = {
                sets: [{
                        soft : [10,20,30],
                        tech : [ 30,40]
                        }],
                        labels: ['soft', 'tech']
                    };
    return  (
        <div>
            <SkillChart chartData = {data} />
        </div>
    )
}

export default SkillPage
